import React, { useState } from 'react';

const ScrapingForm = () => {
  const [url, setUrl] = useState('');
  const [dataType, setDataType] = useState('general');
  const [loading, setLoading] = useState(false);
  const [results, setResults] = useState([]);
  const [error, setError] = useState(null);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError(null);
    setResults([]);

    try {
      const response = await fetch('http://localhost:5001/api/scrape', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify({ url, dataType })
      });

      const data = await response.json();

      if (!response.ok) {
        setError(data.error || 'Unknown error occurred');
      } else {
        setResults(data);
      }
    } catch (err) {
      setError('Failed to fetch data. Please try again.');
    }

    setLoading(false);
  };

  return (
    <div style={{ maxWidth: 600, margin: '2rem auto', padding: '1rem', border: '1px solid #ccc', borderRadius: 8 }}>
      <h2>Web Scraping</h2>
      <form onSubmit={handleSubmit}>
        <div style={{ marginBottom: '1rem' }}>
          <label>Website URL:</label><br />
          <input
            type="text"
            value={url}
            onChange={(e) => setUrl(e.target.value)}
            placeholder="https://example.com"
            required
            style={{ width: '100%', padding: '0.5rem', fontSize: '1rem' }}
          />
        </div>

        <div style={{ marginBottom: '1rem' }}>
          <label>Content Type:</label><br />
          <select
            value={dataType}
            onChange={(e) => setDataType(e.target.value)}
            style={{ width: '100%', padding: '0.5rem', fontSize: '1rem' }}
          >
            <option value="general">General Content</option>
            <option value="news">News Headlines</option>
            <option value="quotes">Quotes</option>
            <option value="weather">Weather</option>
          </select>
        </div>

        <button
          type="submit"
          disabled={loading}
          style={{
            padding: '0.5rem 1rem',
            fontSize: '1rem',
            cursor: loading ? 'not-allowed' : 'pointer',
            backgroundColor: '#667eea',
            color: 'white',
            border: 'none',
            borderRadius: 4
          }}
        >
          {loading ? 'Scraping...' : 'Scrape'}
        </button>
      </form>

      {error && (
        <div style={{ marginTop: '1rem', color: 'red' }}>
          Error: {error}
        </div>
      )}

      {results.length > 0 && (
        <div style={{ marginTop: '2rem' }}>
          <h3>Scraped Results:</h3>
          <ul>
            {results.map((item, index) => (
              <li key={index} style={{ marginBottom: '1rem' }}>
                <strong>{item.title}</strong><br />
                <em>{item.source}</em><br />
                <p>{item.content}</p>
                <a href={item.url} target="_blank" rel="noopener noreferrer">Read more</a>
                <br />
                <small>{new Date(item.timestamp).toLocaleString()}</small>
              </li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
};

export default ScrapingForm;
